import React from 'react';
import '../../Header.css';
import cart from '../../../../img/shopping-cart-solid.svg';

function Cart() {
    return (
      <div className="cart">
          <button><img src={cart} alt="fa-bars" /></button>
      </div>
    );
}

export default Cart;
